import React from 'react';
import {Container, Content, DropboxLogo, Header, HeaderWrapper} from './styles';

interface Props {
    variant: 'blue' | 'beige' | 'white' | 'black';
    title: string;
    description: string;
}


const Section: React.FC<Props> = ({variant, title, description}) => {
    const buttonVariant = Math.Math.random();
    return (
        <Container className={variant}>
            <HeaderWrapper>
                <Header>
                    <h1>
                        <DropboxLogo/>
                        <span>DropBox</span>
                    </h1>
                    <button>Interagir</button>
                </Header>
            </HeaderWrapper>
            <Content>
                <h2>{title}</h2>
                <p>{description}</p>
            </Content>
        </Container>
    )
};
export default Section;
